import "./editProfile.css";

const editProfile = () => {
  return (
    <div id="edit-profile">
      <h2>Edite seus dados</h2>
      <p classname="subtitle">
        Adicione uma imagem de perfil e conte mais sobre você
      </p>
    </div>
  );
};

export default editProfile;
